func getConf(t *testing.T) *config.Config {
	root, err := fs.Lookup("configs/local.toml")
	require.NoError(t, err)
	conf := new(config.Config)
	err = _config.UnmarshalConfigFile(root, conf)
	require.NoError(t, err)
	return conf
}

func getAbiDecoder(t *testing.T, conf *config.Config) fevm.ABIDecoderAPI {
	abiDecoder, err := fevm.NewAbiDecoderClient(*conf.ABIDecoderRPC)
	require.NoError(t, err)
	return abiDecoder
}

func TestDetectContractName(t *testing.T) {
	{
		contract := common.Hex2Bytes(``)
		
		decoder := getAbiDecoder(t, getConf(t))
		
		name, err := decoder.DetectContractProtocol(contract)
		require.NoError(t, err)
		require.Equal(t, "erc721-metadata", name)
		t.Log(name)
	}
	
	{
		contract := common.Hex2Bytes(``)
		
		decoder := getAbiDecoder(t, getConf(t))
		
		name, err := decoder.DetectContractProtocol(contract)
		require.NoError(t, err)
		require.Equal(t, "erc20", name)
		
		t.Log(name)
	}
}

func getABIJson(t *testing.T, path string) []byte {
	f, err := bundle.Templates.Open(path)
	require.NoError(t, err)
	
	defer func() {
		_ = f.Close()
	}()
	
	c, err := io.ReadAll(f)
	require.NoError(t, err)
	
	return c
}

func TestParseABISignatures(t *testing.T) {
	
	decoder := getAbiDecoder(t, getConf(t))
	{
		_, err := decoder.ParseABISignatures(getABIJson(t, "/erc20.json"))
		require.NoError(t, err)
	}
	{
		_, err := decoder.ParseABISignatures(getABIJson(t, "/erc721-metadata.json"))
		require.NoError(t, err)
	}
	{
		_, err := decoder.ParseABISignatures(getABIJson(t, "/erc721.json"))
		require.NoError(t, err)
	}
	{
		_, err := decoder.ParseABISignatures(getABIJson(t, "/fns/FNSRegistry.json"))
		require.NoError(t, err)
	}
	{
		_, err := decoder.ParseABISignatures(getABIJson(t, "/fns/IRegistrar.json"))
		require.NoError(t, err)
	}
	{
		_, err := decoder.ParseABISignatures(getABIJson(t, "/fns/IRegistrarController.json"))
		require.NoError(t, err)
	}
	{
		_, err := decoder.ParseABISignatures(getABIJson(t, "/fns/PublicResolver.json"))
		require.NoError(t, err)
	}
	{
		_, err := decoder.ParseABISignatures(getABIJson(t, "/fns/ReverseRegistrar.json"))
		require.NoError(t, err)
	}
}

