func TestDecodeName(t *testing.T) {
	decoder := getAbiDecoder(t, getConf(t))
	
	filfox := fns.NewFilfoxToken()
	r, err := decoder.DecodeEventInput(
		filfox.PublicResolverABI(),
		common.Hex2Bytes("b7d29e911041e8d9b843369e890bcb72c9388692ba48b65ac54e7214c4c348f7"),
		common.Hex2Bytes(""),
	)
	require.NoError(t, err)
	
	spew.Json(r)
}

